# ------------------ PLAN SELECTION ------------------ #
@bot.callback_query_handler(func=lambda call: call.data.startswith("plan_"))
def handle_plan(call):
    plan_data = {
        "plan_1": ("1 Day TRIAL", "₹50"),
        "plan_5": ("5 Days", "₹200"),
        "plan_30": ("30 Days", "₹1000")
    }
    plan, price = plan_data[call.data]
    text = (f"💳 Payment Details:\n\n"
            f"📝 Plan: {plan}\n"
            f"💰 Amount: {price}\n\n"
            "📲 Scan the QR code below using any UPI app to pay.\n\n"
            "✅ After payment, please send the screenshot here.\n\n"
            "⚠️ Note: Do not send fake payment screenshots!")
    send_qr(call.message.chat.id, text)

